import { Link, NavLink } from "react-router-dom";

function Header (){
    return (
        <div className="sticky top-0 bg-[#9ECAD6] w-full z-40">
            <header className="flex justify-between items-center p-6 text-[#000]">
                <div className="flex gap-2 justify-center items-center">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" className="w-10 object-contain" fill="currentColor">
                        <path d="M16 6l2.29 2.29-4.88 4.88-4-4L2 16.59 3.41 18l6-6 4 4 6.3-6.29L22 12V6h-6z"></path>
                    </svg>
                    <h1 className="text-xl font-bold">Solicio</h1>
                </div>
                <nav className="space-x-6">
                <NavLink to="/" className={({isActive}) => 
                    `hover:underline hover-bg-gray-50 ${isActive ? "text-orange-700" : "text-gray-700"}`
                }>Home</NavLink>
                <NavLink to="/contact" className={({isActive}) => 
                    `hover:underline hover-bg-gray-50 ${isActive ? "text-orange-700" : "text-gray-700"}`
                }>Contact Us</NavLink>
                <NavLink to="/about" className={({isActive}) =>
                    `hover:underline hover-bg-gray-50 ${isActive ? "text-orange-700" : "text-gray-700"}`
                }>About Us</NavLink>
                <NavLink to="/profile" className={({isActive}) =>
                    `hover:underline hover-bg-gray-50 ${isActive ? "text-orange-700" : "text-gray-700"}`
                }>Profile</NavLink>
                <NavLink to="/services" className={({isActive}) =>
                    `hover:underline hover-bg-gray-50 ${isActive ? "text-orange-700" : "text-gray-700"}`
                }>Servi</NavLink>
                </nav>
            </header>
        </div>
    );
}

export default Header;
